🚨💥Last available spots for our #Dolomites Enduro Traverse💥🚨
You have 2 options to join the ultimate Enduro adventure:
1) PRIVATE DATE: Rally up your crew (max 7 riders), choose your preferred date in July or August (4 days/3 nights) and make it happen! The more riders you are, the cheaper the trip!
2) OPEN DATE: If you are alone or a couple of friends, you can join one of the two fixed dates of our partner agency @triberg_biketravel: 29.06. - 02.07.2023 and 14 - 17.09.2023
_
For more details: 
📩andreas@rideonmtb.it
_
Ingredients of the Traverse tour:
✔Dolomites, one of the world's most stunning mountain massifs. A jewel among UNESCO World Heritage Sites!
✔ 4 days / 3 nights
✔Average of 3.500 downhill meters a day along epic singletrails
✔20+ cablecars uplifts
✔4 Van Shuttles
✔3 nights in idyllic mountain huts
✔Challenging Enduro tour on S2-S3 Trails (European Scale) /  Black Diamond-Double Black Diamond Trails (American Scale)
✔100% Fun
